import React, { useState } from "react";
import { Form, Button, Col, Row } from "react-bootstrap";
import axios from "axios";
import "./Intake.css";

function WasteIntake() {
  const [newIntake, setNewIntake] = useState({
    type: "",
    farmerName: "",
    place: "",
    weight: "",
    pricePerTon: "",
    totalPrice: "",
    date: ""
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewIntake((prev) => {
      const updated = { ...prev, [name]: value };
      if (name === "weight" || name === "pricePerTon") {
        const weight = parseFloat(updated.weight) || 0;
        const pricePerTon = parseFloat(updated.pricePerTon) || 0;
        updated.totalPrice = (weight * pricePerTon).toFixed(2);
      }
      return updated;
    });
  };

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("/api/intakes", newIntake);
      setNewIntake({ type: "", farmerName: "", place: "", weight: "", pricePerTon: "", totalPrice: "", date: "" });
    } catch (error) {
      console.error("Error adding new intake:", error);
    }
  };

  return (
    <div className="container">
      <div className="waste-container">
        <h1 className="page-title">Waste Intake Management</h1>
        <p className="page-description">Efficiently add new waste intake records.</p>

        <div className="form-section">
          <h3>Add New Intake</h3>
          <Form onSubmit={handleFormSubmit}>
            <Row>
              <Col md={2}>
                <Form.Control
                  type="text"
                  name="type"
                  value={newIntake.type}
                  onChange={handleInputChange}
                  placeholder="Waste Type"
                  required
                />
              </Col>
              <Col md={2}>
                <Form.Control
                  type="text"
                  name="farmerName"
                  value={newIntake.farmerName}
                  onChange={handleInputChange}
                  placeholder="Farmer Name"
                  required
                />
              </Col>
              <Col md={2}>
                <Form.Control
                  type="text"
                  name="place"
                  value={newIntake.place}
                  onChange={handleInputChange}
                  placeholder="Place"
                  required
                />
              </Col>
              <Col md={2}>
                <Form.Control
                  type="number"
                  name="weight"
                  value={newIntake.weight}
                  onChange={handleInputChange}
                  placeholder="Weight (tons)"
                  required
                />
              </Col>
              <Col md={2}>
                <Form.Control
                  type="number"
                  name="pricePerTon"
                  value={newIntake.pricePerTon}
                  onChange={handleInputChange}
                  placeholder="Price per Ton"
                  required
                />
              </Col>
              <Col md={2}>
                <Form.Control
                  type="date"
                  name="date"
                  value={newIntake.date}
                  onChange={handleInputChange}
                  required
                />
              </Col>
            </Row>
            <Row className="mt-3">
              <Col md={3}>
                <Form.Control
                  type="text"
                  value={newIntake.totalPrice}
                  readOnly
                  placeholder="Total Price"
                />
              </Col>
            </Row>
            <Button className="submit-button mt-3" type="submit">
              Add Intake
            </Button>
          </Form>
        </div>
      </div>
    </div>
  );
}

export default WasteIntake;
